INSERT INTO `entertainment_content` VALUES (44429,'The Blazing Sun',1954,'A rich landlord floods and destroys a village on purpose to prevent the people living there from making a profit off their crops. What he doesn\'t know is that his own daughter is in love with Ahmed, a young man from the village.','PG',NULL),(47673,'White Christmas',1954,'Two talented song-and-dance men team up after the war to become one of the hottest acts in show business. In time they befriend and become romantically involved with the beautiful Haynes sisters who comprise a sister act.','PG',NULL),(49761,'Dark Waters',1956,'Ragab, a poor sailor, returns home to Alexandria after three years of absence, during which he tried to save money to marry his one true love, Hamedah. But there\'s trouble on the harbor, and with an old friend.','PG',NULL),(51390,'Cairo Station',1958,'Qinawi, a physically challenged peddler who makes his living selling newspapers in the central Cairo train station, is obsessed by Hanuma, an attractive young woman who sells drinks. While she jokes with him about a possible relationship, she is actually in love with Abu Siri, a strong and respected porter at the station who is struggling to unionize his fellow workers to combat their boss\' exploitative and abusive treatment.','PG',NULL),(54953,'The Guns of Navarone',1961,'A team of allied saboteurs are assigned an impossible mission: infiltrate an impregnable Nazi-held island and destroy the two enormous long-range field guns that prevent the rescue of 2,000 trapped British soldiers.','PG',NULL),(56379,'Professor',1962,'Sita devi is a very strict aunt for a number of young ladies, and does not allow them to fraternize with males. Along comes Pritam disguised as an elderly Professor Khanna to break every possible rule of the aunt','PG',NULL),(57357,'Saladin the Victorious',1963,'Saladin, the first sultan of Egypt and Syria, leads the Muslim military campaign against the invading Christians from Europe during the Third Crusade.','PG',NULL),(58385,'My Fair Lady',1964,'A snobbish phonetics professor agrees to a wager that he can take a flower girl and make her presentable in high society.','PG',NULL),(60104,'Amrapali',1966,'After a failed conquest, Emperor Ajaatshatru pretends to be a soldier in the enemy\'s army to weaken them from the inside. However, he falls in love with Amrapali by faking his identity.','PG',NULL),(60862,'The Professionals',1966,'An arrogant Texas millionaire hires four adventurers to rescue his kidnapped wife from a notorious Mexican bandit.','PG 13',NULL),(61418,'Bonnie and Clyde',1967,'In the 1930s, bored waitress Bonnie Parker falls in love with an ex-con named Clyde Barrow and together they start a violent crime spree through the country, stealing cars and robbing banks.','18',NULL),(63929,'Monty Python\'s Flying Circus',1969,'A British sketch comedy series with the shows being composed of surreality, risqu? or innuendo-laden humour, sight gags and observational sketches without punchlines.','PG 13',NULL),(64842,'Prince',1969,'To better himself, a spoiled prince temporarily assumes a commoner\'s identity. But he soon learns his palace has been gifted to his father\'s new wife.','PG',NULL),(66999,'Dirty Harry',1971,'When a madman dubbed \'Scorpio\' terrorizes San Francisco, hard-nosed cop, Harry Callahan  famous for his take-no-prisoners approach to law enforcement  is tasked with hunting down the psychopath. Harry eventually collars Scorpio in the process of rescuing a kidnap victim, only to see him walk on technicalities. Now, the maverick detective is determined to nail the maniac himself.','18',NULL),(68562,'FTA',1972,'A documentary about a political troupe headed by actors Jane Fonda and Donald Sutherland which traveled to towns near military bases in the US in the early 1970s. The group put on shows called \"F.T.A.\", which stood for \"F**k the Army\", and was aimed at convincing soldiers to voice their opposition to the Vietnam War, which was raging at the time. Various singers, actors and other entertainers performed antiwar songs and skits during the show.','18',NULL),(69049,'The Other Side of the Wind',2018,'Surrounded by fans and skeptics, grizzled director J.J. \"Jake\" Hannaford returns from years abroad in Europe to a changed Hollywood, where he attempts to make his innovative comeback film.  This film was started in 1970 but never completed during Welles lifetime.','18',NULL),(70047,'The Exorcist',1973,'12-year-old Regan MacNeil begins to adapt an explicit new personality as strange events befall the local area of Georgetown. Her mother becomes torn between science and superstition in a desperate bid to save her daughter, and ultimately turns to her last hope: Father Damien Karras, a troubled priest who is struggling with his own faith.','18',NULL),(71811,'Manoranjan',1974,'Havaldar Ratan is a rookie at the local police station, and is assigned duty on foot patrol on Manoranjan Street, a notorious red-light area, on the very first day of his job. He strikes up a conversation with a good-looking young woman named Nisha, and tells her that there is a possible violation of Suppression of Immoral Trafficking Act taking place on this street. He witnesses several women soliciting men, and decides to call in the paddy wagon, and get them arrested. Alas, one of the men frequenting the prostitutes is none other than Ratan\'s superior officer, who immediately summons Ratan, and has him removed from service on corruption charges. Nisha takes pity on a homeless and unemployed Ratan, and asks him to live with her. He does not want her to sell her body, and so he decides to work at night, and during the day he takes on the guise of a rich Nawab and spends time with her.','PG',NULL),(71853,'Monty Python and the Holy Grail',1975,'King Arthur, accompanied by his squire, recruits his Knights of the Round Table, including Sir Bedevere the Wise, Sir Lancelot the Brave, Sir Robin the Not-Quite-So-Brave-As-Sir-Lancelot and Sir Galahad the Pure. On the way, Arthur battles the Black Knight who, despite having had all his limbs chopped off, insists he can still fight. They reach Camelot, but Arthur decides not  to enter, as \"it is a silly place\".','PG',NULL),(72584,'Wheel of Fortune',1983,'This game show sees contestants solve word puzzles, similar to those used in Hangman, to win cash and prizes determined by spinning a giant carnival wheel.','PG',NULL),(74168,'The Return of the Prodigal Son',1976,'In this Andre Gide adaptation, an activist is released after many years in prison and returns home, shaking up established relationships among his family members at the farm governed by his strict father. Demonstrating Chahines eclecticism, this is an elegant melodrama, exuberant musical, layered allegory, and profound portrait of personal and political disillusionment.','PG',NULL),(75314,'Taxi Driver',1976,'A mentally unstable Vietnam War veteran works as a night-time taxi driver in New York City where the perceived decadence and sleaze feed his urge for violent action, attempting to save a preadolescent prostitute in the process.','18',NULL),(77751,'Alexandria?? Why?',1979,'Set against the panoramic backdrop of war-torn Egypt, director Youssef Chahine tells a highly personal tale of love and determination. Amid the poverty, death and suffering caused by World War II, 18 year-old Yehia, retreats into a private world of fantasy and longing. Obsessed with Hollywood, he dreams of one day studying filmmaking in America, but after falling in love and discovering the lies of European occupation, Yehia profoundly reevaluates his identity and allegiances.','PG',NULL),(79470,'Life of Brian',1979,'Brian Cohen is an average young Jewish man, but through a series of ridiculous events, he gains a reputation as the Messiah. When he\'s not dodging his followers or being scolded by his shrill mother, the hapless Brian has to contend with the pompous Pontius Pilate and acronym-obsessed members of a separatist movement. Rife with Monty Python\'s signature absurdity, the tale finds Brian\'s life paralleling Biblical lore, albeit with many more laughs.','18',NULL),(79749,'Alibaba Aur 40 Chor',1979,'The movie is based on the story of Ali Baba and the Forty Thieves, from the One Thousand and One Nights or Arabian Tales. The role of Ali Baba is played by Dharmendra and Hema Malini play Morjina.','PG',NULL),(79807,'Richard Pryor: Live in Concert',1979,'Richard Pryor delivers monologues on race, sex, family and his favorite targethimself, live at the Terrace Theatre in Long Beach, California.','18',NULL),(79833,'Lupin the Third: The Castle of Cagliostro',1979,'After a successful robbery leaves famed thief Lupin the Third and his partner Jigen with nothing but a large amount of expertly crafted counterfeit bills, he decides to track down the forgers responsibleand steal any other treasures he may find in the Castle of Cagliostro, including the \'damsel in distress\' he finds imprisoned there.','PG',NULL),(80453,'The Blue Lagoon',1980,'Two small children and a ship\'s cook survive a shipwreck and find safety on an idyllic tropical island. Soon, however, the cook dies and the young boy and girl are left on their own. Days become years and Emmeline and Richard make a home for themselves surrounded by exotic creatures and nature\'s beauty. But will they ever see civilization again?','18',NULL),(80653,'Dostana',1980,'Vijay and Ravi are best friends (hence the name \'Dostana\') who do not even question each other about their careers. Vijay, a police officer and Ravi, a lawyer, while the former catches the criminals who smuggle, Ravi on the other hand bail those criminals, employed by Daaga. One day, both Vijay and Ravi meet Sheetal at different places and times, and both fancy the same girl, Sheetal, but Vijay\'s love was more serious. Ravi admits his love for Sheetal to Vijay and is devastated but Vijay decides to sacrifice his love and give Sheetal\'s hand. However, there was a misunderstanding when Daaga decided to stir up Vijay and Ravi\'s friendship by showing a photo of Vijay and Sheetal to Ravi. They became rivals for the first time and Ravi started to turn to be an enemy of Vijay. Do their friendship recover? Does Ravi get to know the truth? Do Sheetal get back with Vijay?','PG',NULL),(81071,'The Long Riders',1980,'The origins, exploits and the ultimate fate of the James gang is told in a sympathetic portrayal of the bank robbers made up of brothers who begin their legendary bank raids because of revenge.','18',NULL),(81848,'Danger Mouse',1981,'Danger Mouse, the world\'s greatest secret agent, and his side-kick Penfold work to foil the evil schemes of Baron Greenback.','PG',NULL),(82329,'Endless Love',1981,'Two young kids fall in love with each other. But the passion is too consuming for the parents of Jade. The parents try to stop them from seeing each other. But when this doesn\'t work, David burns down the house and is sent away. This doesn\'t stop him from seeing her. When he gets out he goes to look for her. But the passion for his first love is too strong and she has to leave.','18',NULL),(83437,'Knight Rider',1982,'Michael Long, an undercover police officer, is shot while investigating a case and left for dead by his assailants. He is rescued by Wilton Knight, a wealthy, dying millionaire and inventor who arranges life-saving surgery, including a new face and a new identity--that of Michael Knight. Michael is then given a special computerized and indestructible car called the Knight Industries Two Thousand (nicknamed KITT), and a mission: apprehend criminals who are beyond the reach of the law. The series depicts Michael\'s exploits as he and KITT battle the forces of evil on behalf of the Foundation for Law and Government.','PG 9',NULL),(83564,'Annie',1982,'An orphan in a facility run by the mean Miss Hannigan, Annie believes that her parents left her there by mistake. When a rich man named Oliver \"Daddy\" Warbucks decides to let an orphan live at his home to promote his image, Annie is selected. While Annie gets accustomed to living in Warbucks\' mansion, she still longs to meet her parents. So Warbucks announces a search for them and a reward, which brings out many frauds.','PG',NULL),(84042,'An Egyptian Story',1982,'Acclaimed actor Nour El Cherif here plays Egyptian filmmaker Yehia Mourad some thirty years after we last see him in \"Alexandria, Why?\"  Though successful in his work, Yehia has grown distant from his wife and children and suers a symbolic blockage of the heart while shooting the final scenes of his latest film. After being flown to England for evaluation, it\'s determined that Yehia must undergo emergency surgery.  Fact and fiction blend seamlesslywith healthy doses of cleverly  absurdist fantasyas the film explores the various personalities and forces that have made Yehia (and Youssef Chahine) the man he has become.','PG',NULL),(84352,'Monty Python Live at the Hollywood Bowl',1982,'Monty Python perform many of their greatest sketches at the Hollywood Bowl, including several from pre-Python days.','18',NULL),(84492,'The Little Wars',1982,'Beirut resident Soraya is drawn to two men: daredevil photographer Nabil and Talal, who must embrace his feudal heritage when his father is kidnapped.','PG',NULL),(85333,'Christine',1983,'Geeky student Arnie Cunningham falls for Christine, a rusty 1958 Plymouth Fury, and becomes obsessed with restoring the classic automobile to her former glory. As the car changes, so does Arnie, whose newfound confidence turns to arrogance behind the wheel of his exotic beauty. Arnie\'s girlfriend Leigh and best friend Dennis reach out to him, only to be met by a Fury like no other.','18',NULL),(86815,'Thomas & Friends',1984,'Thomas & Friends is a British children\'s television series, which had its first broadcast on the ITV network on 4 September 1984. It is based on The Railway Series of books by the Reverend Wilbert Awdry and his son, Christopher Awdry. These books deal with the adventures of a group of anthropomorphised locomotives and road vehicles who live on the fictional Island of Sodor. The books were based on stories Wilbert told to entertain his son, Christopher during his recovery from measles. From Series one to four, many of the stories are based on events from Awdry\'s personal experience.','PG',NULL),(87800,'A Nightmare on Elm Street',1984,'Teenagers in a small town are dropping like flies, apparently in the grip of mass hysteria causing their suicides. A cop\'s daughter, Nancy Thompson, traces the cause to child molester Fred Krueger, who was burned alive by angry parents many years before. Krueger has now come back in the dreams of his killers\' children, claiming their lives as his revenge. Nancy and her boyfriend, Glen, must devise a plan to lure the monster out of the realm of nightmares and into the real world...','18',NULL),(87843,'Once Upon a Time in America',1984,'A former Prohibition-era Jewish gangster returns to the Lower East Side of Manhattan over thirty years later, where he once again must confront the ghosts and regrets of his old life.','18',NULL),(89108,'Waiting for the Hearse',1985,'Mama Cora, who is almost eighty years old, has three sons and a daughter. She lives with one of them, who has serious financial problems. The family meets one day to celebrate an anniversary meal, and that is when the problem arises: which of them will take care of her?','PG',NULL),(90589,'Adam: His Song Continues',1986,'Follows the true story of John and Reve Walsh who, after their child was murdered, fought to raise national awareness of the problem of missing children.','PG',NULL),(91106,'The George McKenna Story',1988,'Washington plays a school principal in a tough inner city Los Angeles high school out to rid it of drugs, gangs, low moral of teachers, and restore educational values.','PG',NULL),(91939,'She\'s Gotta Have It',1986,'The story of Nola Darling\'s simultaneous sexual relationships with three different men is told by her and by her partners and other friends. All three men wanted her to commit solely to them; Nola resists being \"owned\" by a single partner.','18',NULL),(92005,'Stand by Me',1986,'Gordie, Chris, Teddy and Vern are four friends who decide to hike to find the corpse of Ray Brower, a local teenager, who was hit by a train while plucking blueberries in the wild.','18',NULL),(92099,'Top Gun',1986,'A heart-pounding combination of action, music and incredible aerial photography helped make Top Gun the blockbuster hit. of 1986. Top Gun takes a look at the danger and excitement that awaits every pilot at the Navy\'s prestigious fighter weapons school. Tom Cruise is superb as Lt. Pete \"Maverick\" Mitchell, a daring young flyer who\'s out to become the best. And Kelly McGillis sizzles as the civilian instructor who teaches Maverick a few things you can\'t learn in a classroom.','PG',NULL),(92948,'Eddie Murphy Raw',1987,'Eddie Murphy delights, shocks and entertains with dead-on celebrity impersonations, observations on \'80s love, sex and marriage, a remembrance of Mom\'s hamburgers and much more.','18',NULL),(93058,'Full Metal Jacket',1987,'A pragmatic U.S. Marine observes the dehumanizing effects the U.S.-Vietnam War has on his fellow recruits from their brutal boot camp training to the bloody street fighting in Hue.','18',NULL),(94052,'Strange Voices',1987,'A family begins to fall apart when their eldest daughter is diagnosed with schizophrenia.','PG',NULL),(94478,'High Risk',1988,'High Risk is a program aired by the CBS television network as part of its 1988 fall lineup.\n\nThe genesis of High Risk was a 1988 strike by members of both the Writers Guild of America, East and Writers Guild of America, west against the Alliance of Motion Picture and Television Producers. Unable to produce regular, scripted series, programs such as High Risk were put together to serve as replacements under fear of a two-year lockout.\n\nThe CBS 100% in-house production featured \"high-risk\" stunts and jobs such as Border Patrol agent, automobile repo men, cave explorers, and thrilling roller-coaster testers.\n\nIntended as a two-year commitment, strike or no strike, High Risk received unanimous condemnations and was cancelled after being presented for one night. The show was hosted by Wayne Rogers.','PG 9',NULL),(95262,'Mobile Suit Gundam: Char\'s Counterattack',1988,'In UC 0093 the Federation has recovered from its defeat and has created a new anti-colonial special forces unit to deal with rebel forces: Londo Bell. Elsewhere in space Char Aznable re-appears out of self imposed hiding with a declaration that he now commands his own Neo-Zeon movementand intends to force the emigration of Earth\'s inhabitants to space by bringing about an apocalypse.','PG',NULL),(95945,'Quiet Victory: The Charlie Wedemeyer Story',1988,'Film that tells the story of Los Gatos (California) high school football coach Charlie Wedemeyer. At 31, onetime football pro Wedemeyer is living the American dream; a winning team, a happy marriage and public adulation.','PG',NULL),(96179,'A Stoning in Fulham County',1988,'Religious beliefs clash with the law when an Amish infant is killed in a rural community.','PG',NULL),(96286,'Too Young The Hero',1988,'TV movie based upon the true story of Calvin Graham, who, as a 12 year old boy, enlisted in the US Navy during WWII.','PG',NULL),(96643,'Major Dad',1989,'Major Dad is an American sitcom created by Richard C. Okie and John G. Stephens, developed by Earl Pomerantz, that originally ran from 1989 to 1993 on CBS, starring Gerald McRaney as Major John D. MacGillis and Shanna Reed as his wife Polly. The cast also includes Beverly Archer, Matt Mulhern, Jon Cypher, Marisa Ryan, Nicole Dubuc and Chelsea Hertford.','PG 9',NULL),(96694,'Saved by the Bell',1989,'Lovable schemer Zack Morris leads his pals on adventures at California\'s Bayside High School. The friends navigate relationships, final exams, school dances, breakups and more while frequently frustrating their principal, Mr. Richard Belding, who does his best to keep them in check.','PG',NULL),(97926,'Mujrim',1989,'The film follows the story of Shankar, who is regarded as a criminal by the society after being in jail for ten years since childhood.','PG',NULL),(98084,'Pet Sematary',1989,'Dr. Louis Creed\'s family moves into the country house of their dreams and discover a pet cemetery at the back of their property. The cursed burial ground deep in the woods brings the dead back to life -- with \"minor\" problems. At first, only the family\'s cat makes the return trip, but an accident forces a heartbroken father to contemplate the unthinkable.','18',NULL),(98237,'The Ryan White Story',1989,'The story of Ryan White, a 13-year-old haemophiliac who contracted AIDS from factor VIII, which was used to control this disorder.','PG',NULL),(98635,'When Harry Met Sally...',1989,'During their travel from Chicago to New York, Harry and Sally debate whether or not sex ruins a friendship between a man and a woman. Eleven years later, and they\'re still no closer to finding the answer.','18',NULL),(98904,'Seinfeld',1989,'A stand-up comedian and his three offbeat friends weather the pitfalls and payoffs of life in New York City in the \'90s. It\'s a show about nothing.','PG 9',NULL),(98999,'Agneepath',1990,'The movie depicts the life of a young boy, Vijay (Amitabh Bachchan), whose father gets brutally lynched by a mobster Kancha Cheena. It\'s a journey of his quest for revenge, which leads him to become a gangster as an adult. Watch out for Amitabh Bachchan in one of the most powerful roles of his career. Will Vijay lose his family in the process of satisfying his vengeance?','PG',NULL),(99077,'Awakenings',1990,'Dr. Malcolm Sayer, a shy research physician, uses an experimental drug to \"awaken\" the catatonic victims of a rare disease. Leonard is the first patient to receive the controversial treatment. His awakening, filled with awe and enthusiasm, proves a rebirth for Sayer too, as the exuberant patient reveals life\'s simple but unutterably sweet pleasures to the introverted doctor.','PG 13',NULL),(99429,'Dil',1990,'Raja lives a poor lifestyle along with his dad, Hazariprasad and mom. He attends college where he has several run-ins with wealthy fellow-collegian, Madhu Mehra. Matters escalate to such an extent that she accuses him of sexually molesting her. When his dad comes to know, he decides to seize this chance to get rich quickly, masquerades as a wealthy businessman, approaches Mr. Mehra, and arranges for their children to get married. Murphy\'s law prevails at the time of the engagement - changing everyone\'s lives forever.','PG',NULL),(99833,'In Defense of a Married Man',1990,'When a defense lawyer\'s adulterous husband becomes the prime suspect in the murder of the woman he was cheating with, his wife chooses to defend him. Can she overcome his betrayal while searching for the truth?','PG',NULL),(99858,'Alexandria, Again and Forever',1989,'Set in 1987 against the backdrop of a hunger strike by the Egyptian film industry, Chahine himself steps in to play Yehia, the famed Egyptian director whose life is chronicled in \"Alexandria, Why?\" and \"An Egyptian Story\". Obsessed with Amr, the handsome actor he discovered and cast as his alter-ego in parts one and two of The Alexandria Trilogy, Yehia pressures Amr to star in various film projects that change even as Yehia\'s perception of the young actor begins to change. He first casts Amr as Hamlet, which the actor deems too demanding for his talents, then as the lead in a musical biopic of demigod Alexander the Great, who founded the city of Alexandria in 332 B.C.','PG',NULL),(100758,'Teenage Mutant Ninja Turtles',1990,'A quartet of humanoid turtles, trained by their mentor in ninjitsu, must learn to work together to face the menace of Shredder and the Foot Clan.','PG',NULL),(100848,'Unspeakable Acts',1990,'Two psychologist try to demonstrate that a man is a pedophile and has abused many children.','PG',NULL),(102058,'Out of Life',1991,'Patrick Perrault, a photo-journalist covering the war in Beirut in the late 1980s, is himself caught up in the hostilities when one day he is picked up and bundled into a car at gun-point. Blind-folded, he is taken to an unknown location where he discovers that he is being taken hostage by Lebanese guerrillas.','PG',NULL),(102227,'Knight Rider 2000',1991,'In the future, guns are banned and criminals are frozen for the duration of their sentences. A recent spate of killings involving handguns brings Michael Knight back to fight for justice, but he insists of the help of KITT, his artificially-intelligent car from decades ago. The only problem is that KITT has been deactivated.','PG',NULL),(102492,'My Girl',1991,'Vada Sultenfuss is obsessed with death. Her mother is dead, and her father runs a funeral parlor. She is also in love with her English teacher, and joins a poetry class over the summer just to impress him. Thomas J., her best friend, is \"allergic to everything\", and sticks with Vada despite her hangups. When Vada\'s father hires Shelly, and begins to fall for her, things take a turn to the worse...','PG',NULL),(102537,'Nightmare in Columbia County',1991,'The recounting of a terrible crime that wracked a family and galvanized police in South Carolina in the 1980\'s. Southern beauty pageant winner Dawn Smith is targeted by a sadistic stalker whose obsession with her leads him to kidnap her younger sister.','PG',NULL),(103060,'Teenage Mutant Ninja Turtles II: The Secret of the Ooze',1991,'The Turtles and the Shredder battle once again, this time for the last cannister of the ooze that created the Turtles, which Shredder wants to create an army of new mutants.','PG',NULL),(103123,'A Triumph of the Heart: The Ricky Bell Story',1991,'Ricky Bell, an all-pro running back with the Tampa Bay Buccaneers, who died of a rare muscle disease in the prime of his career. The plot centers on Bell\'s relationship with a father-less handicapped boy, and his efforts to be a big brother to him. The boy ends up being an inspiration for Bell when his disease makes the athlete more afflicted than the boy.','PG',NULL),(105265,'A River Runs Through It',1992,'A River Runs Through is a cinematographically stunning true story of Norman Maclean. The story follows Norman and his brother Paul through the experiences of life and growing up, and how their love of fly fishing keeps them together despite varying life circumstances in the untamed west of Montana in the 1920\'s.','PG',NULL),(106064,'Power Rangers',1993,'A team of teenagers with attitude are recruited to save Angel Grove from the evil witch, Rita Repulsa, and later, Lord Zedd, Emperor of all he sees, and their horde of monsters.','PG 9',NULL),(106145,'Star Trek: Deep Space Nine',1993,'At Deep Space Nine, a space station located next to a wormhole in the vicinity of the liberated planet of Bajor, Commander Sisko and crew welcome alien visitors, root out evildoers and solve all types of unexpected problems that come their way.','PG 9',NULL),(106206,'Aashik Aawara',1993,'Raised by a kindly thief, orphaned Jimmy goes on the run from goons and falls in love with Jyoti, whose father indirectly caused his parents\' deaths.','PG',NULL),(106582,'Cliffhanger',1993,'A year after losing his friend in a tragic 4,000-foot fall, former ranger Gabe Walker and his partner, Hal, are called to return to the same peak to rescue a group of stranded climbers, only to learn the climbers are actually thieving hijackers who are looking for boxes full of money.','18',NULL),(106655,'Damini',1993,'The theme revolves around the character Damini who represents truth and innocence. After her marriage in renowned wealthy family, Damini happens to see a cruel act done by her brother-in-law. She wants the victim to get justice, but the family including her husband oppose her, which leads her to leave the house. Soon she is helped by a drunkard, an ex-advocate, who helps her in all respect to reach to her aim and therefore justice','PG',NULL),(106701,'Dennis the Menace',1993,'Mr. Wilson\'s ever-present annoyance comes in the form of one mischievous kid named Dennis. But he\'ll need Dennis\'s tricks to uncover a collection of gold coins that go missing when a shady drifter named Switchblade Sam comes to town.','PG',NULL),(106965,'Free Willy',1993,'When maladjusted orphan Jesse vandalizes a theme park, he is placed with foster parents and must work at the park to make amends. There he meets Willy, a young Orca whale who has been separated from his family. Sensing kinship, they form a bond and, with the help of kindly whale trainer Rae Lindley, develop a routine of tricks. However, greedy park owner Dial soon catches wind of the duo and makes plans to profit from them.','PG',NULL),(107004,'Geronimo: An American Legend',1993,'The Apache Indians have reluctantly agreed to settle on a US Government approved reservation. Not all the Apaches are able to adapt to the life of corn farmers. One in particular, Geronimo, is restless. Pushed over the edge by broken promises and necessary actions by the government, Geronimo and thirty or so other warriors form an attack team which humiliates the government by evading capture, while reclaiming what is rightfully theirs.','PG 13',NULL),(107060,'Gumrah',1993,'Roshni Chadha makes her living, singing in various places and this makes her the breadwinner of her home. She soon gets to meet the handsome and wealthy Rahul Malhotra, who finds out that she can actually sing professionally and he helps her to attain this goal, which soon became a success and Roshni falls in love with Rahul and finds out that he has the same feelings for her. On a foreign trip, Roshni is arrested by the police for having in her possession cocaine, Rahul disappears leaving Roshni in hot-soup and now she must prepare to undergo her prison terms as there is no one to help her.','PG',NULL),(107206,'In the Line of Fire',1993,'Veteran Secret Service agent Frank Horrigan is a man haunted by his failure to save President Kennedy while serving protection detail in Dallas. Thirty years later, a man calling himself \"Booth\" threatens the life of the current President, forcing Horrigan to come back to protection detail to confront the ghosts from his past.','18',NULL),(107362,'Last Action Hero',1993,'Danny is obsessed with a fictional movie character action hero Jack Slater. When a magical ticket transports him into Jack\'s latest adventure, Danny finds himself in a world where movie magic and reality collide. Now it\'s up to Danny to save the life of his hero and new friend.','PG 13',NULL),(107554,'Menace II Society',1993,'Sobering and incisive, this cautionary drama centers on a street tough 18-year-old facing a moral quandary while trying to turn his life around.','18',NULL),(108041,'Sankofa',1993,'On a photo shoot in Ghana, an American model slips back in time, becomes enslaved on a plantation and bears witness to the agony of her ancestral past.','PG',NULL),(108291,'Wild Tango',1993,'A biopic based on the life of one of the pioneer argentine rock stars \'Tanguito\'. The movie tells the story of his rise and fall from grace, encompassed in violent times of a military regime.','18',NULL),(108308,'Teenage Mutant Ninja Turtles III',1993,'The four turtles travel back in time to the days of the legendary and deadly samurai in ancient Japan, where they train to perfect the art of becoming one. The turtles also assist a small village in an uprising.','PG',NULL),(108800,'Heartbreak High',1994,'The ins and outs of the classroom lives of a group of students who attend the fictional Hartley High School in Sydney.','16',NULL),(108847,'The Magic School Bus',1994,'An eccentric schoolteacher takes her class on wondrous educational field trips with the help of a magical school bus.','PG',NULL),(108927,'Sister, Sister',1994,'Twins Tia Landry and Tamera Campbell were