ague that would wipe out both humans and vampires.','18',NULL),(191182,'Hitler: A Career',1977,'A keen chronicle of the unlikely rise to power of Adolf Hitler (1889-1945) and a dissection of the Third Reich (1933-1945), but also an analysis of mass psychology and how the desperate crowd can be deceived and shepherded to the slaughterhouse.','PG',NULL),(191397,'The Replacements',2000,'Maverick old-guard coach Jimmy McGinty is hired in the wake of a players\' strike to help the Washington Sentinels advance to the playoffs. But that impossible dream hinges on whether his replacements can hunker down and do the job. So, McGinty dusts off his secret dossier of ex-players who never got a chance (or screwed up the one they were given) and knits together a bad-dream team of guys who just may give the Sentinels their title shot.','PG 13',NULL),(192087,'Govindha Govindha',1993,'A Tantric believes that by donating a virgin woman\'s head to gods crown, would bring down the universe to his feet. How the hero and heroine gets entangled in the underworld nexus, while rescuing the robbery, forms the crux of the plot.','PG',NULL),(194542,'Wild Things',1998,'When teen-socialite Kelly Van Ryan and troubled bad girl Suzie Toller accuse guidance counselor Sam Lombardo of rape, he\'s suspended by the school, rejected by the town, and fighting to get his life back. One cop suspects conspiracy, but nothing is what it seems...','18',NULL),(196229,'Zoolander',2001,'Clear the runway for Derek Zoolander, VH1\'s three-time male model of the year. His face falls when hippie-chic Hansel scooters in to steal this year\'s award. The evil fashion guru Mugatu seizes the opportunity to turn Derek into a killing machine. It\'s a well-designed conspiracy and only with the help of Hansel and a few well-chosen accessories like Matilda can Derek make the world safe for male models everywhere.','PG 13',NULL),(196291,'She\'s Gotta Have It',2017,'Nola Darling struggles to define herself and divide her time among her friends, job and three lovers. A new take on Spike Lee\'s film, in 10 episodes.','16',NULL),(196355,'The Other',1999,'Adam is the son of a wealthy Egyptian-American family who is studying at UCLA and returns home for a brief vacation. Upon his arrival he meets beautiful reporter Hanane, with whom he begins an intense love affair, and eventually they marry. Trouble arises when Hanane\' s journalistic interests lead her to the corrupt business affairs of Adam\'s parents, who are interested in building an American tourist compound that would allow Americans further control of Egypt\'s tourist industry, and make them a whole lot richer.','PG',NULL),(200353,'The Parkers',1999,'The Parkers is an American sitcom that aired on UPN from August 30, 1999, to May 10, 2004. A spin-off of UPN\'s Moesha, The Parkers features the mother-daughter team of Nikki and Kim Parker. The Parkers\' signature \"Heeyyy\" greeting became very popular in the early 2000s.','PG 9',NULL),(202477,'Monty Python\'s Fliegender Zirkus',1972,'Monty Python\'s Fliegender Zirkus consisted of two 45-minute Monty Python German television comedy specials produced by WDR for West German television. The two episodes were first broadcast in January and December 1972 and were shot entirely on film and mostly on location in Bavaria, with the first episode recorded in German and the second recorded in English and then dubbed into German.','16',NULL),(206921,'Mann',1999,'A young woman falls in love with a handsome playboy, while aboard a Singapore to India cruise. They make plans to meet again, but fate may have other plans...','PG',NULL),(208903,'Disco Dancer',1982,'Anil, a street singer, is humiliated and driven out of Bombay along with his mother. However, he soon becomes a famous performer but the enemies from his past try to destroy his hard-earned career.','PG',NULL),(211634,'Soldier',1998,'The story follows a young man (Bobby Deol) who flees India and arrives in Australia seeking vengence for something