ented cast that includes Breckin Meyer, Rachel Blanchard, Seann William Scott, Amy Smart, Fred Ward, Tom Green, Anthony Rapp, Andy Dick, and Ethan Suplee.','18',NULL),(216817,'Hum Saath Saath Hain',1999,'Ramkishen and his wife Mamta have three sons. Prem and Vinod have sweethearts in Preeti and Vivek marries Sangeeta. Since Vivek is Mamta\'s step-son, she plots to alienate him, but will she succeed?','PG',NULL),(217085,'Te quiero',2001,'Jean and Sylvia left France with a stolen diamond to start a new life in South America. They land in Lima to live their passion. But the diamond is not easy to sell. They meet a French couple and hope to sell them the stolen diamond.','PG',NULL),(219432,'Bloodline',2015,'A dramatic thriller that explores the demons lurking beneath the surface of a contemporary American family. The Rayburns are hard-working pillars of their Florida Keys community. But when the black sheep son comes home for the 45th anniversary of his parents\' hotel, he threatens to expose the Rayburns\' dark secrets and shameful past, pushing his siblings to the limits of family loyalty.','16',NULL),(221027,'Blow',2001,'A boy named George Jung grows up in a struggling family in the 1950\'s. His mother nags at her husband as he is trying to make a living for the family. It is finally revealed that George\'s father cannot make a living and the family goes bankrupt. George does not want the same thing to happen to him, and his friend Tuna, in the 1960\'s, suggests that he deal marijuana. He is a big hit in California in the 1960\'s, yet he goes to jail, where he finds out about the wonders of cocaine. As a result, when released, he gets rich by bringing cocaine to America. However, he soon pays the price.','18',NULL),(221344,'Herod\'s Law',1999,'Mexico, 1949. The fable of a janitor turned Mayor on a little town lost in the Mexican desert, who gradually realizes how far his new acquainted power and corruption can get him.','18',NULL),(221735,'Cardcaptor Sakura',1998,'Sakura Kinomoto, an elementary school student who discovers that she possesses magical powers after accidentally freeing a set of magical cards from the book they had been sealed in for years. She is then tasked with retrieving those cards in order to avoid an unknown catastrophe from befalling the world.','PG 9',NULL),(222270,'Phir Bhi Dil Hai Hindustani',2000,'Rival news-reporters, Ajay Bakshi, and Ria Bannerjee engage in a comic war to be the first to interview notorius M.K. Sharma, in which Ria succeeds. Then the two are thrust in a battle for their lives as they must decide whether to save an innocent terrorist from being hanged, or sacrifice their very lives themselves.','PG 13',NULL),(222518,'Adventures of Sonic the Hedgehog',1993,'Follow the adventures of Sonic the Hedgehog, and his sidekick Tails, as they attempt to stop Dr. Robotnik and his array of robots from taking over the planet Mobius.','PG 9',NULL),(230412,'Khoon Khoon',1973,'As a crazed killer blazes a trail of blood through an anxious city, a hardened cop aims to take him down by any means in this remake of Dirty Harry.','PG',NULL),(233856,'Hello Brother',1999,'A ghost seeking revenge for his death haunts the man who received his heart in a transplant.','PG',NULL),(235918,'The Fairly OddParents',2001,'The zany, fast-paced adventures of a 10-year-old boy and his fairy godparents, who inadvertently create havoc as they grant wishes for their pint-sized charge.','PG 9',NULL),(237395,'Lal Patthar',1971,'Raja Kumar Bahadur alias Gyan Shankar Rai has been a total abstainer all his life, never touching a drop of alcohol, and keeping away from women and all known vices all his life. Then one day he sees a young woman named Saudamani, and instantly falls in love with her. He finds out about her background, and virtually buys her, and brings her to his palatial home. This is when he takes to drinking, and wooing her, and renaming her Madhuri, but refrains from marrying her. Years later, he sees another beautiful woman, about half his age, named Sumita, meets with her parents, pays off their debts, and marries her in the bargain.','PG',NULL),(238784,'Gilmore Girls',2000,'Set in the charming town of Stars Hollow, Connecticut, the series follows the captivating lives of Lorelai and Rory Gilmore, a mother/daughter pair who have a relationship most people only dream of.','PG 13',NULL),(239195,'Survivor',2000,'A reality show contest where sixteen or more castaways split between two or more ?Tribes are taken to a remote isolated location and are forced to live off the land with meager supplies for roughly 39 days. Frequent physical challenges are used to pit the tribes against each other for rewards, such as food or luxuries, or for ?Immunity, forcing the other tribe to attend ?Tribal Council, where they must vote off one of their players.','PG 9',NULL),(239495,'Jaal',1986,'Shankar\'s father leaves the family for Meenabai. He later learns that his father is dead. He sets out to find out Meenabai, who he thinks is behind his father\'s death.','PG',NULL),(239682,'Muqaddar Ka Faisla',1987,'Muqaddar ka Faisla, is the story of Pandit Krishna Kant. A poor, but extremely honest, upright, God-fearing man, who refuses to compromise on his principles.','PG',NULL),(243174,'Children of Shatila',1999,'Many people first became aware of the Shatila refugee camp in Lebanon after the shocking and horrific Sabra-Shatila massacre that took place there in 1982. Located in Beirut\'s \"belt of misery,\" the camp is home to 15,000 Palestinians and Lebanese who share a common experience of displacement, unemployment and poverty.  Fifty years after the exile of their grandparents from Palestine, the children of Shatila attempt to come to terms with the reality of being refugees in a camp that has survived massacre, siege and starvation.  Director Mai Masri focuses on two Palestinian children in the camp: Farah, age 11 and Issa, age 12. When these children are given video cameras, the story of the camp evolves from their personal narratives as they articulate the feelings and hopes of their generation.','PG',NULL),(243585,'Stuart Little 2',2002,'Stuart, an adorable white mouse, still lives happily with his adoptive family, the Littles, on the east side of Manhattan\'s Central Park. More crazy mouse adventures are in store as Stuart, his human brother, George, and their mischievous cat, Snowbell, set out to rescue a friend.','PG',NULL),(245674,'Thir13en Ghosts',2001,'Arthur and his two children, Kathy and Bobby, inherit his Uncle Cyrus\'s estate: a glass house that serves as a prison to 12 ghosts. When the family, accompanied by Bobby\'s Nanny and an attorney, enter the house they find themselves trapped inside an evil machine \"designed by the devil and powered by the dead\" to open the Eye of Hell. Aided by Dennis, a ghost hunter, and his rival Kalina, a ghost rights activist out to set the ghosts free, the group must do what they can to get out of the house alive.','18',NULL),(247102,'Girlfriends',2000,'Girlfriends is an American comedy-drama sitcom that premiered on September 11, 2000, on UPN and aired on UPN\'s successor network, The CW, before being cancelled in 2008. The final episode aired on February 11, 2008.\n\nWhen Girlfriends returned in fall 2007 for its eighth season, it became the longest-running live-action sitcom on network television that was on air that year, as well as one of the highest-rated scripted shows on television among African American adults and women 18-34, including its spin-off The Game.','PG 9',NULL),(248012,'Fiza',2000,'In 1993 Fiza\'s brother disappears during the riots in Mumbai. In 1999 Fiza is tired of waiting and goes looking for him.','PG',NULL),(248126,'Kabhi Khushi Kabhie Gham',2001,'Rahul, the adoptive son of business magnate Yash Raichand, feels eternal gratitude to his father for rescuing him from a life of poverty. Yet, when Yash forbids his love of poor Anjali, Rahul marries her and moves to London with new wife and