killing, Mike Sullivan finds himself on the run in attempt to save the life of his son and at the same time looking for revenge on those who wronged him.','18',NULL),(259057,'Tim Allen: Men Are Pigs',1990,'Comedian Tim Allen shares his enthusiasm for power tools, automobiles, grunting, and the myriad obsessions of the American male in this special for the Showtime premium cable network, which was aired a few years before he rose to stardom with the television sitcom Home Improvement.','PG',NULL),(262158,'Dogs',2018,'These six intimate stories explore the abiding emotional bonds that form between dogs and their caregivers, no matter the circumstances.','PG 9',NULL),(267130,'Yodha',1991,'Suraj Singh is addicted to drugs and as a result witnessed his girlfriend being raped in front of his eyes with him being helpless, from here on he vows to put an end to all drug dealers and started to work as a hit man for an underworld don, Daaga also known as Justice Dharmesh Agnihotri. He also meets and make enemy with a lawyer, Karan Srivastav, who is looking for the murderer of his father, journalist Chandrakant. As time proceeds, Suraj and Karan would frequently get into brawls in front of the society to the extent that each of them will now do anything to kill the other. Unknown to both that one person is responsible for there lives being upside down and he is under the veil of respectability - non other than Justice Dharmesh Agnihotri alias Dagga.','PG',NULL),(267804,'The One',2001,'A sheriff\'s deputy fights an alternate universe version of himself who grows stronger with each alternate self he kills.','PG 13',NULL),(268639,'Singapore',1960,'When his employee disappears in Singapore, Shyam travels from India to investigate the absence and becomes entangled in a deadly plot.','PG',NULL),(270053,'Vizontele',2001,'The story takes place in a small town (called Hakkari) in Turkey at the beginning of the 70\'s. The time has come to bring technology into that small town. The first Television (or called Visiontele by the citizens) arrives and the chaos begins.','PG',NULL),(272397,'Kath & Kim',2002,'Kath & Kim is a character-driven Australian television situation comedy series. The series was created by, and is written by Jane Turner and Gina Riley who play the title characters: a suburban mother and daughter with a dysfunctional relationship. The series main characters consist of Kath Day-Knight, a cheerful 50-year-old woman, her self-indulgent daughter Kim Craig, Kath\'s boyfriend and second husband, the metrosexual Kel Knight, as well as Kim\'s estranged husband Brett Craig and her lonely, overweight \"second best friend\" Sharon Strzelecki. The series is set in the fictional suburb of Fountain Lakes in Melbourne. It is primarily filmed in Patterson Lakes.\n\nThe series was conceived by Turner and Riley in the early 1990s as a weekly segment of the Australian comedy series Fast Forward. The skit was then developed into a full-series. The first series of Kath & Kim premiered on ABC TV on 16 May 2002, with three further series following, while a television movie, entitled Da Kath and Kim Code, was broadcast nationally on 25 November 2005. Kath & Kim has garnered much critical acclaim since its debut, winning two Logie Awards, for \"Outstanding Comedy Programme\" and the \"Best Television Drama Series\" award at the Australian Film Institute Awards. In Australia, it has become a pop culture phenomenon, and is a success with audiences nationwide. Internationally, the series has spawned a cult fanbase, and in 2006 it was announced an American version of the series would be produced, to air on NBC. Riley and Turner served as executive producers on the US version. The American version was also picked up by Seven, which debuted the program on 12 October 2008, just three days after its debut in the United States.','PG',NULL),(274428,'Divine Intervention',2002,'Santa Claus tries to outrun a gang of knife-wielding youth. It\'s one of several vignettes of Palestinian life in Israel - in a neighborhood in Nazareth and at Al-Ram checkpoint in East Jerusalem. Most of the stories are droll, some absurd, one is mythic and fanciful; few words are spoken. A man who goes through his mail methodically each morning has a heart attack. His son visits him in hospital. The son regularly meets a woman at Al-Ram; they sit in a car, hands caressing. Once, she defies Israeli guards at the checkpoint; later, Ninja-like, she takes on soldiers at a target range. A red balloon floats free overhead. Neighbors toss garbage over walls. Life goes on until it doesn\'t.','PG',NULL),(277027,'I Am Sam',2001,'Sam, a neurodivergent man, has a daughter with a homeless woman who abandons them when they leave the hospital, leaving Sam to raise Lucy on his own. But as Lucy grows up, Sam\'s limitations as a parent start to become a problem and the authorities take her away. Sam convinces high-priced lawyer Rita to take his case pro bono and in turn teaches her the value of love and family.','PG 13',NULL),(277371,'Not Another Teen Movie',2001,'On a bet, a gridiron hero at John Hughes High School sets out to turn a bespectacled plain Jane into a beautiful and popular prom queen in this outrageous send-up of the teen movies of the 1980s and \'90s.','18',NULL),(281491,'Still Game',2002,'Cult Scottish comedy about the lives of two OAP\'s (Old Age Pensioners) Jack and Victor and their views on how it used to be in the old days and how bad it is now in the fictional town of Craiglang.','PG 13',NULL),(282003,'Minsara Kanavu',1997,'Priya decides that she wants to be a nun, much to the horror of her father and Thomas, the boy who is in love with her. Thomas decides to enlist the help of Deva to change her mind.','PG',NULL),(283770,'Pedro El Escamoso',2001,'Pedro el escamoso is a popular telenovela filmed in Colombia and produced by the Colombian network, Caracol TV.\n\nThis novela is about a cheesy but charming macho man who lives in a small town in Colombia. He moves to the city to find his fortune and encounters a series of events and people that change his life dramatically. Pedro is the epitome of a man who can get all the women he wants, but can\'t get the one he loves.','PG 13',NULL),(284770,'One on One',2001,'A sportscaster becomes a full-time dad when his ex-wife decides to accept a job out of the country and his teenage daughter, Breanna, moves in with him.','PG 13',NULL),(285823,'Once Upon a Time in Mexico',2003,'Hitman \"El Mariachi\" becomes involved in international espionage involving a psychotic CIA agent and a corrupt Mexican general.','18',NULL),(286907,'Qila',1998,'When an abusive landowner is murdered, his twin brother sets out to find the killer but quickly discovers that everyone, it seems, wanted him dead.','PG',NULL),(287570,'Monty Python: Live at Aspen',1998,'In March 1998 in Aspen, Colorado, the surviving members of the Monty Paython team - John Cleese, Terry Gilliam, Eric Idle, Terry Jones and Michael Palin - shared a stage together for the first time in 18 years. Even more remarkably, Graham Chapman was there too....in an urn! The occasion for this renuion was the US Comedy Arts Festival Tribute to Monty Python, hosted by Robert Klien in front of a live audience.','PG',NULL),(289649,'Okupas',2000,'During the year 2000, Ricardo, Pollo, Walter and Chiqui occupied a house in the Buenos Aires neighborhood of Congreso. The four young people forge a strong friendship that leads them to go through different stories of crime, drugs and social marginalization.','16',NULL),(290223,'InuYasha',2000,'Kagome Higurashi is a modern day young girl who lives with her family by the old Higure shrine. Unbeknownst to Kagome, she is the reincarnation of priestess Kikyo and posseses the \"Jewel of Four Souls\" (the Shikon jewel). One ill-fated day, Kagome locates an ancient well near her home and is abruptly transported through the well and into a feudal Japan, inhabited by demons. There, she encounters Inuyasha, son of a powerful demon father and a human mother, who is pinned to a tree by an enchanted arrow.','PG 13',NULL),(290988,'Trailer Park Boys',2001,'Follow the booze-fueled misadventures of three longtime pals and petty serial criminals who run scams from their Nova Scotia trailer park.','16',NULL),(292490,'Dil Chahta Hai',2001,'Three inseparable childhood friends are just out of college. Nothing comes between them - until they each fall in love, and their wildly different approaches to relationships creates tension.','PG',NULL),(294149,'The Mole',2001,'Players working as a team complete a series of difficult physical and psychological tests, each worth a set amount of money. One of the players, however, is a \"Mole\" or saboteur, whose goal is to foil the efforts of the other players without revealing his or her identity. At the end of each episode, the group is given a quiz on The Mole\'s identity. The player who knows the least information about The Mole is then immediately sent home. In the final episode, The Mole is revealed and the one remaining player wins the jackpot, up to $1,000,000.','PG 13',NULL),(294967,'Tim Allen: Rewires America',1991,'This is arguably Tim Allen\'s best stand-up show ever and this show truly solidified Tim Allen\'s unique slant on masculinity becoming the backbone for his TV show ?Home Improvement.','PG',NULL),(297241,'Kyo Kii... Main Jhuth Nahin Bolta',2001,'Inpired from the movie \"Liar Liar\", this movie is about a lawyer (Govinda) who lies his way through marriage and career. His wife (Sushmita Sen) falls in love with him because of his honesty and when she finds out of his dishonesty she threatens to divorce him. Their son, to avoid the divorce, wishes on a shooting star that his father should lose the ability to lie. What happens after that is an enjoyable journey.','PG',NULL),(298130,'The Ring',2002,'Rachel Keller is a journalist investigating a videotape that may have killed four teenagers. There is an urban legend about this tape: the viewer will die seven days after watching it. Rachel tracks down the video... and watches it. Now she has just seven days to unravel the mystery of the Ring so she can save herself and her son.','PG 13',NULL),(301231,'Duniya',1984,'Mohan Kumar\'s diligence and honesty lands him in trouble with Balwant Singh Kalra, Jugal Kishore Ahuja, and Mr. Bhandari. Together the trio frame and imprison Mohan and make him watch helplessly as his wife is killed. Years later, Mohan Kumar is released from prison, his only goal in life is to avenge his humiliation and wrongful arrest at the hands of the trio. With the help of Dinesh Verma, he establishes himself again, and starts the process of bringing death and destruction to the trio. The trio are well aware of his presence, and decide to send one of their men, Ravi, to spy on him. Ravi falls in love with Verma\'s daughter, Roma, and decides to change sides to help Verma and Mohan, but Mohan will not have anything to do with Ravi, and asks him to leave. Ravi then becomes a target by the trio and their men, and has to save himself, and the only way he can redeem himself is by turning the tables over Mohan, who is none other than his own father.Duniya','PG',NULL),(305727,'Kevin James: Sweat the Small Stuff',2001,'Television\'s \"King of Queens\" reigns again in this Comedy Central special -- the network\'s first-ever hour-long show devoted entirely to one comic, taped live in July 2001 at New York City\'s Hudson Theatre. James riffs on life\'s many \"royal\" pains, including waiting in line with strangers, negotiating with the airport ticket counter clerk, underwear wedgies, boringly slow answering machine messages and more.','PG',NULL),(307403,'Sam Kinison: Breaking the Rules',1987,'This is a great performance. Through yelling and energetic story-telling, he talks about marriage, drugs, being arrested (thanks to his ex-wife), pleasing women, religion, and much, much more.','18',NULL),(312528,'The Cat in the Hat',2003,'Conrad a