e confuses the mission as Connor tries to determine whether Wright has come from the future or the past -- and whether he\'s friend or foe.','PG 13',NULL),(439630,'Initial D',2005,'After winning his first competition, Takumi focuses his attention on drift racing, a sport he has unknowingly perfected while delivering tofu in his father\'s Toyota AE86.','PG',NULL),(439856,'The Trailer Park Boys Xmas Special',2004,'In this holiday prequel, its 1997 and Sunnyvale Trailer Park is getting ready for the holiday season. Julians got a great idea to make money this Christmas, Ricky gets confused between God and Santa, and Bubbles tries to get the Boys together for an annual Christmas bonfire.  Meanwhile, Mr. Lahey is thrilled because Christmas is the only day of the year that his wife Barb allows him to have a few drinks. Directed by series creator Mike Clattenburg, this hour-long special takes place before Jamie was J-Roc, before Randy and Lahey were a couple, and before the Shitmobile was missing a door.','PG',NULL),(440963,'The Bourne Ultimatum',2007,'Bourne is brought out of hiding once again by reporter Simon Ross who is trying to unveil Operation Blackbriar, an upgrade to Project Treadstone, in a series of newspaper columns. Information from the reporter stirs a new set of memories, and Bourne must finally uncover his dark past while dodging The Company\'s best efforts to eradicate him.','PG 13',NULL),(442236,'Fuga',2006,'Could a brilliant composer\'s music actually be killing his loved ones? Eliseo can\'t help but believe it when his younger sister dies tragically and then his pianist Georgina suddenly dies on the piano. Completely traumatized, Eliseo is taken to a mental hospital where he can find escape only through music.','PG',NULL),(448267,'Zozo',2005,'A Lebanese boy gets separated from his family during the civil war and ends up in Sweden.','PG',NULL),(448694,'Puss in Boots',2011,'Long before he even met Shrek, the notorious fighter, lover and outlaw Puss in Boot