...','PG',NULL),(459724,'Vientos de agua',2006,'Vientos de agua is a 2006 cult Argentine- Spanish mini TV series created by Juan Jos? Campanella. The drama traces a Spaniard\'s emigration to Argentina in the 1930s, and, years later, his son\'s return to modern-day Spain.\n\nIt aired in Spain in January 2006, on Telecinco for only one series of 13 episodes.\n\nWhile a hit in Argentina, because of lower ratings in Spain it was taken out of the prime-time slot to 1.00 in morning, and was eventually cancelled due to downloading of series from the internet.\n\nDespite a campaign of support to continue into a second series it only produced 13 episodes. Despite this the series was a hit in DVD sellings.','16',NULL),(460681,'Supernatural',2005,'When they were boys, Sam and Dean Winchester lost their mother to a mysterious and demonic supernatural force. Subsequently, their father raised them to be soldiers. He taught them about the paranormal evil that lives in the dark corners and on the back roads of America ... and he taught them how to kill it. Now, the Winchester brothers crisscross the country in their \'67 Chevy Impala, battling every kind of supernatural threat they encounter along the way. ','PG 13',NULL),(460895,'Rang De Basanti',2006,'After a group of friends graduate from Delhi University, they listlessly haunt their old campus, until a British filmmaker casts them in a film she\'s making about freedom fighters under British rule. Although the group is largely apolitical, the tragic death of a friend owing to local government corruption awakens their patriotism. Inspired by the freedom fighters they represent in the film, the friends collectively decide to avenge the killing.','PG 13',NULL),(461936,'Don',2006,'DCP DeSilva sees a way to bring to justice the feared head of a criminal empire by recruiting a man named Vijay, who looks exactly like the crime boss. The ruse works too well, and soon Vijay finds his life in danger when DeSilva, the only one who knows his true identity, dies.','PG 13',NULL),(462499,'Rambo',2008,'When governments fail to act on behalf of captive missionaries, ex-Green Beret John James Rambo sets aside his peaceful existence along the Salween River in a war-torn region of Thailand to take action.  Although he\'s still haunted by violent memories of his time as a U.S. soldier during the Vietnam War, Rambo can hardly turn his back on the aid workers who so desperately need his help.','18',NULL),(464160,'Chup Chup Ke',2006,'A debt-ridden young man attempts suicide, but is rescued only to find that his luck is finally turning.','PG',NULL),(465538,'Michael Clayton',2007,'A law firm brings in its \'fixer\' to remedy the situation after a lawyer has a breakdown while representing a chemical company that he knows is guilty in a multi-billion dollar class action suit.','18',NULL),(467200,'The Other Boleyn Girl',2008,'A sumptuous and sensual tale of intrigue, romance and betrayal set against the backdrop of a defining moment in European history: two beautiful sisters, Anne and Mary Boleyn, driven by their family\'s blind ambition, compete for the love of the handsome and passionate King Henry VIII.','PG 13',NULL),(468458,'Brother\'s Shadow',2006,'Jake Groden is the black sheep of his family. Ankle deep in fish guts, he serves out his parole in Alaska. Then, after a decade of self-imposed exile, he is forced to return to his Brooklyn family. He soon discovers that his perfect brother, Michael is dead, and he begins trying to take what Michael had- a beautiful wife, adoring son, control of the family furniture business and the love of their gruff father. For Jake, the price of a new life is his identity.','PG',NULL),(469589,'Sir! No Sir!',2005,'Sir! No Sir! is a documentary film about the anti-war movement within the ranks of the United States Military during the Vietnam War. It consists in part of interviews with Vietnam veterans explaining the reasons they protested the war or even defected. The film tells the