av enters the picture. He is the counterpoint to everything that Roy is as frantic as Roy is calm, as dumb as Roy is smart, as messy and untidy as Roy is smooth. They have only one thing in common. Aditya is a conman too. At least he thinks of himself as one. In Roy\'s book, he\'s an embarrassment. But one that won\'t go away!','PG',NULL),(476680,'Naruto: Ninja Clash in the Land of Snow',2004,'Naruto is thrilled when he is sent on a mission to protect his favorite actress, Yukie Fujikaze, on the set of her new movie, The Adventures of Princess Gale. But when the crew ventures out to film in the icy, foreboding Land of Snow, Yukie mysteriously flees! Naruto and his squad set off to find her... unaware that three Snow Ninja lie in wait, with a sinister purpose that will force Yukie to face her hidden past!','PG 13',NULL),(476884,'Taxi No. 9 2 11',2006,'A cabbie and businessman both in need of big money partake in a two-hour adventure together.','PG',NULL),(477071,'Premonition',2007,'A depressed housewife who learns her husband was killed in a car accident the day previously, awakens the next morning to find him alive and well at home, and then awakens the day after to a world in which he is still dead.','PG 13',NULL),(477653,'Frontiers of Dreams and Fears',2001,'This heartfelt documentary from award-winning filmmaker Mai Masri explores the enduring friendship that evolves between two Palestinian girlsMona, who was born and raised in the economically marginalized Shatila refugee camp in Beirut, and Manar, who lives in the Dheisha refugee camp under Israeli control.  The two girls begin their friendship as penpals, sharing the similarities and differences of life in the two refugee camps. Mona and Manar are finally able to meet face-to-face at the Lebanese-Israeli border during Israel\'s withdrawal from South Lebanon. But when the second intifada suddenly erupts around them shortly thereafter, both girls must face heart-breaking changes in their lives.','PG',NULL),(4780