lways left her at home, while he socialized. Bebo did not want Jasmeet to end up like her, so got her admitted in an English Medium school, encouraged to mingle with Caucasian friends, and as a result Jasmeet was transformed in to Jazz - a stunningly beautiful young woman, British in looks, talk, habits, and heart. Manmohan\'s plans to get her married to an Indian boy are all in vain. His friend, Parvez Khan, is in a similar situation with his son, Imran, openly romancing a Caucasian blonde, Susan. Manmohan decides to take his family for a tour in India...','PG',NULL),(795461,'Scary Movie 5',2013,'Home with their newly-formed family, happy parents Dan and Jody are haunted by sinister, paranormal activities. Determined to expel the insidious force, they install security cameras and discover their family is being stalked by an evil dead demon.','PG 13',NULL),(800003,'Delta Farce',2007,'Three bumbling Army reservists are hustled onto a plane headed for combat in Iraq -- but the fact that the plane drops them in Mexico doesn\'t stop them from \"liberating\" what they believe to be the Middle East.','PG 13',NULL),(800039,'Forgetting Sarah Marshall',2008,'When Sarah Marshall dumps aspiring musician Peter Bretter for rock star Aldous Snow, Peter\'s world comes crashing down. His best friend suggests that Peter should get away from everything and to fly off to Hawaii to escape all his problems. After arriving in Hawaii and meeting the beautiful Rachel Jansen, Peter is shocked to see not only Aldous Snow in Hawaii, but also Sarah Marshall.','18',NULL),(800325,'The Dirt',2019,'The story of M?tley Cr??e and their rise from the Sunset Strip club scene of the early 1980s to superstardom.','18',NULL),(800956,'Life in a Metro',2007,'Six different stories, about nine people, each with different issues and problems, all occurring within one place: the METRO.','PG',NULL),(800981,'Anthony Kaun Hai?',2006,'Small-time crook, Champa Chaudhary alias \'Champ\' forges passports, photographs