nd state control.','PG 13',NULL),(914376,'The Innocent Man',2018,'In a story that gained national attention with John Grishams best-selling non-fiction book, The Innocent Man: Murder and Injustice in a Small Town, the six-part documentary series The Innocent Man focuses on two murders that shook the small town of Ada, Oklahoma, in the 1980s  and the controversial chain of events that followed.','16',NULL),(920464,'Manorama Six Feet Under',2007,'Satyaveer is an engineer suspended for allegedly accepting a bribe. However, Satyaveer, proud author of a tawdry and thoroughly unsuccessful crime novel, is approached by a woman named Manorama to investigate her husband, whom she suspects of having an affair.','18',NULL),(922424,'Falafel',2006,'Everything bad that can happen on the way to a party happens to young Tou on this nighttime trip though Beirut.','PG',NULL),(923688,'Ezra',2007,'Ezra, jeune ex-soldat Sierra-L?onais, essaie tant bien que mal de retrouver des rep?res pour revenir ? une vie normale apr?s la guerre civile qui a ravag? son pays. Son quotidien est partag? entre un centre de r?habilitation psychologique et un tribunal de r?conciliation nationale organis? sous l\'?gide de l\'ONU. Durant le proc?s en r?habilitation auquel Ezra participe, il doit affronter sa soeur qui l\'accuse du meurtre de leurs parents. Ezra, qui a travers? cette violente guerre civile compl?tement drogu? et alcoolis?, ne se souvient de rien. Ezra reconna?tra-t-il l\'horreur et par ce fait, permettra-t-il ? sa soeur et ? sa communaut? villageoise d\'acc?der au pardon ?','PG',NULL),(934949,'Twins Mission',2007,'When a precious Tibetan bead is stolen by rogue members of the mysterious Gemini Clan, the protectors of the bead enlist the help of some righteous former Gemini Clan members to retrieve the bead and bring the evil disciples to justice.','PG',NULL),(938331,'Sinbad: Afros and Bellbottoms',1993,'Sinbad brings the \'70s back with a nostalgic stand-up special dedicated to the films, fashion and other flashbacks from that era.','PG 13',NULL),(938332,'Sinbad: Nothin\' but the Funk',1998,'Enjoy Comedic Superstar Sinbad as he gives us one of his most stellar stand up performances, shot on the beautiful island of Aruba at the Guillermo P. Trinidad Theatre. As always, Sinbad shows why hes a veteran in comedy since the 80s, with an entertaining show that the entire family can enjoy.','PG',NULL),(938333,'Sinbad: Son of a Preacher Man',1996,'Experience veteran comedian Sinbad as he returns to his college town of Denver and performs at the Paramount Theatre for this next installment of his famed HBO Comedy Specials. Sinbad: Son of a Preacher Man is a self-styled monologue that comments on the perils of skiing, para-sailing during a bad vacation, fashion trends in lingerie, and more!','PG',NULL),(948103,'Gurren Lagann',2007,'In the distant future, mankind has lived quietly and restlessly underground for hundreds of years, subject to earthquakes and cave-ins. Living in one such village are 2 young men: one named Simon who is shy and na?ve, and the other named Kamina who believes in the existence of a ?surface world above their heads.','PG 13',NULL),(962637,'The Devil\'s Own',1997,'Frankie McGuire, one of the IRA\'s deadliest assassins, draws an American family into the crossfire of terrorism. But when he is sent to the U.S. to buy weapons, Frankie is housed with the family of Tom O\'Meara, a New York cop who knows nothing about Frankie\'s real identity. Their surprising friendship, and Tom\'s growing suspicions, forces Frankie to choose between the promise of peace or a lifetime of murder.','18',NULL),(962853,'Dale\'s Supermarket Sweep',1993,'Dale\'s Supermarket Sweep was a UK game show based on the American Supermarket Sweep TV show format.','PG',NULL),(964516,'Fashion',2008,'A small-town girl finally realizes her dream of becoming a famous supermodel but soon finds out that there\'s a price for her glamorous new life.','PG 13',NULL),(972534,'iCarly',2007,'Wa