 escape it, is to get away from Shion, which would leave her unguarded, then the demon, whose only goal is to kill Shion will do so, thus meaning the end of the world. Naruto decides to challenge this \"prediction of death.\"','PG 13',NULL),(990433,'A Love Story',2007,'Ian Montes is a picture of success. Despite being a son of a shipping tycoon, Ian refused to just ride in his father\'s empire. He built his own real estate company and earned his first million at a very young age. He never looked back since then. Driven by his ambition to become better, if not as good as his father, Ian managed to make it on his own. But behind all the glory is a man yearning for love and recognition.','PG',NULL),(993840,'Army of the Dead',2021,'Following a zombie outbreak in Las Vegas, a group of mercenaries take the ultimate gamble: venturing into the quarantine zone to pull off the greatest heist ever attempted.','18',NULL),(994314,'Code Geass: Lelouch of the Rebellion',2006,'Japan has been invaded and conquered by the Britannian Empire. Japan is now known as Area 11 and its citizens known as Elevens. The Britannian Empire takes away Japan\'s autonomous power and imposes its rule through the use of Knightmares. The Empire\'s rule has never faltered, but cracks have begun to show...','PG 13',NULL),(1002563,'The Young Messiah',2016,'Tells the story of Jesus Christ at age seven as he and his family depart Egypt to return home to Nazareth. Told from his childhood perspective, it follows young Jesus as he grows into his religious identity.','PG 13',NULL),(1010422,'Life\'s Speed Bump',2006,'Seeking job opportunities, a young man arrives in Cairo and becomes increasingly involved with the family of a wealthy businessman.','PG',NULL),(1017456,'Race',2008,'Ranvir and Rajiv are half brothers who own a huge stud farm in South Africa. Ranvir is a very shrewd and aggressive man while Rajiv is laid back, and a chronic alcoholic. Sophia, Ranvir\'s personal secretary adores and loves him. Ranvir is unaware of her feelings. Shaina, an Indian ramp model in Durban loves Ranvir but through a twist of fate gets married to his younger brother Rajiv. When she discovers that Rajiv is a chronic alcoholic, her world is shattered. Ranvir too is disturbed as he has sacrificed his love for his younger brother because Rajiv had promised to leave alcohol for good if he marries Shaina. In a weak moment Ranvir and Shaina come very close to each other. When Rajiv starts suspecting, all hell breaks loose. A murder is committed, a contract killing is issued. A sharp tongued detective R.D., getting wise on the proceedings, starts an intriguing investigation with his brainless bimbo assistant Mini','PG 13',NULL),(1018765,'Our Brand Is Crisis',2015,'Based on the documentary \"Our Brand Is Crisis\", this feature focuses on the use of American political campaign strategies in South America.','18',NULL),(1020042,'Old Thieves: The Legend of Artegio',2007,'Is the story of a generation of thieves who achieved their greatest victories in the sixties; their distinctive code of ethics, the various categories of delinquents inhabiting the city?s streets, their alliances with high ranking police officials that allowed them to operate, the betrayals that followed, and the price they ended up paying.','PG',NULL),(1024648,'Argo',2012,'As the Iranian revolution reaches a boiling point, a CIA \'exfiltration\' specialist concocts a risky plan to free six Americans who have found shelter at the home of the Canadian ambassador.','18',NULL),(1024942,'Just Another Love Story',2007,'Jonas is a Copenhagen homicide scene photographer, happily married, with two kids. One day, his car stalls, another car slams into him, runs head on into a third car and flips into the ditch. The other driver, Julia, is critically injured. He visits her in the hospital and is greeted by her family, who assumes he must be the Sebastian she told them about, the new fiance she met in Vietnam.','PG',NULL),(1024943,'Om Shanti Om',2007,'Om, a junior film artist, is smitten by Shantipriya, a renowned actress, but is killed while trying to save her from a fire accident. Thirty years later, he is reborn and sets out to avenge her death.','PG',NULL),(1033796,'Den-noh Coil',2007,'Denn? Coil, Coil  A Circle of Children, is a Japanese science fiction anime television series depicting a near future where semi-immersive augmented reality technology has just begun to enter the mainstream. The series takes place in the fictional city of Daikoku, a hotbed of AR development with an emerging city-wide virtual infrastructure. It follows a group of children as they use AR glasses to unravel the mysteries of the half real, half Internet city, using a variety of illegal software tools, techniques, and virtual pets to manipulate the digital landscape.\n\nDenn? Coil, in development for over a decade, is the series director debut of Japanese animator Mitsuo Iso. It premiered on NHK Educational TV on May 12, 2007. Due to the animators involved in its production and its unusually high-profile television broadcast time slot, Denn? Coil was highly anticipated.','PG 9',NULL),(1034007,'Alias Grace',2017,'Based on the true story of Grace Marks, a housemaid and immigrant from Ireland who was imprisoned in 1843, perhaps wrongly, for the murder of her employer Thomas Kinnear. Grace claims to have no memory of the murder yet the facts are irrefutable. A decade after, Dr. Simon Jordan tries to help Grace recall her past.','16',NULL),(1037116,'One Piece: The Desert Princess and the Pirates: Adventure in Alabasta',2007,'A re-telling of the Alabaster Arc from One Piece (TV). Luffy and his crew come to rescue a land in the midst of a civil war, due to a powerful devil fruit user.','PG 13',NULL),(1037705,'The Book of Eli',2010,'A post-apocalyptic tale, in which a lone man fights his way across America in order to protect a sacred book that holds the secrets to saving humankind.','18',NULL),(1043451,'Delhi-6',2009,'Roshan, an NRI, arrives in Old Delhi with his ailing grandmother and starts to rediscover himself before getting caught in a religious dispute that shakes the once peaceful neighborhood.','PG',NULL),(1045658,'Silver Linings Playbook',2012,'After spending eight months in a mental institution, a former teacher moves back in with his parents and tries to reconcile with his ex-wife.','18',NULL),(1047832,'Linewatch',2008,'Academy Award Winner Cuba Gooding, Jr. is a Border Patrol Officer in the New Mexico desert with a secret past that is about to catch up with him. When his old gang leader tracks him down and forces him to smuggle drugs across the border, he must choose between the life he swore to leave behind and saving his family at any cost.','18',NULL),(1059455,'The Legend of Bruce Lee',2008,'The story of the legendary martial arts icon Bruce Lee following him from Hong Kong to America and back again, leading up to his tragic death at the age of 32.','PG',NULL),(1059786,'Eagle Eye',2008,'Jerry Shaw and Rachel Holloman are two strangers whose lives are suddenly thrown into turmoil by a mysterious woman they have never met. Threatening their lives and family, the unseen caller uses everyday technology to control their actions and push them into increasing danger. As events escalate, Jerry and Rachel become the country\'s most-wanted fugitives and must figure out what is happening to them.','PG 13',NULL),(1063056,'From Within',2008,'When the citizens of a small evangelical town systematically begin committing suicide, a young girl struggling to reconcile her Christian upbringing with her desire to experience the outside world finds her faith put to the ultimate test.','18',NULL),(1064899,'Queen of the South',2016,'Teresa flees Mexico after her drug-runner boyfriend is murdered. Settling in Dallas, she looks to become the country\'s reigning drug smuggler and to avenge her lover\'s murder.','16',NULL),(1070874,'The Trial of the Chicago 7',2020,'What was supposed to be a peaceful protest turned into a violent clash with the police. What followed was one of the most notorious trials in history.','18',NULL),(1071815,'Naruto: Guardians of the Crescent Moon Kingdom',2006,'Naruto Uzumaki, Kakashi Hatake, Sakura Haruno, and Rock Lee are assigned to protect the prince of the Land of the Moon, Michiru, during his world trip; other escorts had been hired, but quit due to being treated poorly. The Land of the Moon is a very wealthy nation, so Michiru tends to buy whatever he wants, and has a very materialistic worldview. His Hikaru, also acts in much the same manner.','PG 13',NULL),(1074443,'Trotro',2004,'Trotro is a little donkey with a head full of ideas. He knows exactly what he likes and doesn\'t like. He\'s a positive and engaging hero, with whom young children will easily identify.','PG',NULL);
